    kh = hashlib.sha256('https://github.com/FIRandZAH/encode'.encode()).digest()
    raw = aku_hanya(orang_biasa)
    iv = raw[:16]
    ct = raw[16:]
    c = AES.new(kh, AES.MODE_CBC, iv)
    dec = unpad(c.decrypt(ct), AES.block_size)
    return dec.decode()
